import React from 'react';


function UserDescription(props) {


  const Delete = () => {
    console.log('okk');
  }

  return (
    <tr>
      <td>{props.id}</td>
      <td>{props.email}</td>
      <td>{props.fisrtname}</td>
      <td>{props.lastname}</td>
      <td><button type="button" onClick={Delete} className="btn btn-secondary">Delete</button>
      </td>

  </tr>
 
  );
}

export default UserDescription
